import React from 'react';

import {FiCheck, FiX} from 'react-icons/fi'

import HeaderAluno from '../../components/headerAluno/index';
import Footer from '../../components/footer/index';

import './style.css';

function ConfirmacaoAluno(){

    const alunosConfirmar = ()=>{
        return(
            <div className="confirmar">
                <img src="" alt="" className="imgExemplo"/>
                <div>
                    <h3>Nome</h3>
                    <h4>CPF</h4>
                </div>

                <div>
                    <FiCheck className="aceitar"/>
                    <FiX className="recusar"/>
                </div>
            </div>
        );
    }

    return(
        <div>
            <HeaderAluno/>

            <div>
                <div className="div-menu">
                    <h1 className="sublinhar">Confirmação</h1>
                    <h1>Cadastro</h1>
                </div>

                <div className="div-confirmacao">
                    <h2>Empresa</h2>
                    <h2 className="sublinhar">Aluno</h2>
                </div>

                <div className="AlunosConfirmar">
                    {alunosConfirmar()}
                    {alunosConfirmar()}
                    {alunosConfirmar()}
                    {alunosConfirmar()}
                    {alunosConfirmar()}
                    {alunosConfirmar()}
                </div>
            </div>

            <Footer/>
        </div>
    );
}

export default ConfirmacaoAluno;
